description:
Stefani and Monique are rivals on the same team, competing for the same boy, and a win in the National Cheerleading World Championships in Bakersfield, California.
After Stefani suffers a fatal accident in a botched but fabulous flip, she meets her guardian angel, Penny Flame, and promptly makes a deal to go back to earth to avenge her loss. She reappears in the body of Hillary Scott, and from the gates of Heaven, all hell breaks loose. Paul Thomas presents Debbie Does Dallas...Again, the most ambitious Debbie ever made, and the inspiration for a major reality tv show! See five Vivid superstars lead the cheer for sex, sex and more sex in the Debbie to end all Debbies! Vivid does it...again!

